 function CreateMultTable(TableId,RowCount,ColCount,ParamInRow,TableDataArray) 
 {
 	if(ColCount>ParamInRow) return; 
 	var TableData = new Array();	
 	var NormalColCount = ColCount -1;
 	TableData.push('<table border =1 style = "font-size:15px"><tbody>');
 	for (var i = 0; i < RowCount; i++) 
 	{
 		TableData.push('<tr>');
 		for (var j = 0; j < ColCount; j++)
 		{
 			if(j < NormalColCount)  
 				TableData.push('<td><nobr>' + TableDataArray[i*ParamInRow+j] + '</nobr></td>');
 			else  
 			{
 				TableData.push('<td><nobr>');
 				var ParamCountInCell = ParamInRow - ColCount +1;
 				for(k =0; k<ParamCountInCell; k++)
 				{
 					TableData.push(TableDataArray[i*ParamInRow+j+k]);	
 					TableData.push('<br>');
 				}
 				TableData.pop(); 
 				TableData.push('</nobr></td>');
 			}	
 		}
 		TableData.push('</tr>');
 	}
 	TableData.push('</tbody><table>');
 	document.getElementById(TableId).innerHTML = TableData.join('');
 } 
 
 function CreateTable(TableId,RowCount,ColCount,TableDataArray) 
 {
 	var TableData = new Array();
 	TableData.push('<table border =1 style = "font-size:15px"><tbody>');
 	if((ColCount==-1)&&(RowCount>0))
 	{
 		ColCount = (TableDataArray.length-1)/RowCount;	
 	}
 	else if((RowCount==-1)&&(ColCount>0))
 	{
 		RowCount = (TableDataArray.length-1)/ColCount;	 
 	}
 	else
 	{
 		//return;
 	} 
 	for (var i = 0; i < RowCount; i++) 
 	{
 		TableData.push('<tr>');
 		for (var j = 0; j < ColCount; j++)
 		{
 			TableData.push('<td><nobr>' + TableDataArray[i*ColCount+j]+ '</nobr></td>');
 		}
 		TableData.push('</tr>');
 	}	
 	TableData.push('</tbody><table>');
 	if(TableDataArray.length == 0)	
 	{
 		document.getElementById(TableId).style.display = "none";
 	}
 	else
 	{
 		document.getElementById(TableId).innerHTML = TableData.join('');
 	}
 } 
 
 function CreateTableWithTwoLine(TableId,ColCount,TableDataArray) 
 {
 	var TableData = new Array();
 	TableData.push('<table border =1 style = "font-size:15px"><tbody>');	
 	var i = 0;
 	while(i<TableDataArray.length-1)
 	{
 		TableData.push('<tr><td align="center" rowspan = 2><nobr>' + TableDataArray[i++]+ '</nobr></td>');	
 		for (var j = 0; j < ColCount-1; j++)
 		{
 			TableData.push('<td><nobr>' + TableDataArray[i++]+ '</nobr></td>');
 		}
 		TableData.push('</tr><tr>');
 		for (var j = 0; j < ColCount-1; j++)
 		{
 			TableData.push('<td><nobr>' + TableDataArray[i++]+ '</nobr></td>');
 		}
 		TableData.push('</tr>');	
 	}	
 	TableData.push('</tbody><table>');
 	document.getElementById(TableId).innerHTML = TableData.join('');
 } 
 
 function DisplayHideControl(ControlId,ControlText)
 {
 	var ControlObj = document.getElementById(ControlId);
 	if(ControlText.length==0)	
 	{
 		ControlObj.style.display = 'none';
 	}
 	else
 	{
 		ControlObj.innerHTML = ControlText;
 	}
 }
 
 function FloatFrame()
 {
 	var IndexDiv = document.getElementById("SelectButtonDiv"); 
 	var target_pos=document.body.scrollTop + document.body.clientHeight/3;    
 	var step=20;     
 	if(IndexDiv.style.posTop>target_pos) step*=-1    
 		IndexDiv.style.posTop += step;       
 	if(Math.abs(IndexDiv.style.posTop-target_pos)>Math.abs(step)) setTimeout("FloatFrame()",1);
 }
